import React,{Component} from 'react';

 export default class TourList extends Component {
     render() {
         return 
       <article className="tour">
       <div className="img-container">
       <img src="https://images.pexels.com/photos/894443/pexels-photo-894443.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500" alt=""></img>
       </div>
       </article>
         
     }
 }
